script: |
  super -f text -I q360.spq | sort > q360.out

inputs:
  - name: q360.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + col2 BETWEEN col0 AND NULL OR NOT CAST ( + 55 AS REAL ) NOT IN ( + + 64 + - ( - col2 ) + - col0 + - - 59 );
  - name: tab0

outputs:
  - name: q360.out
    data: |
